INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (126401, 2002, 1, 10001, 1.47, "2023/06/30 12:00:00", -470.0, 1, "2023/09/22 14:59:59", "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (126401, 2002, 1, 10002, 2.15, "2023/06/30 12:00:00", -470.0, 2, "2023/09/22 14:59:59", "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (126501, 2002, 1, 10003, 0.0, "2023/06/30 12:00:00", -470.0, 2, "2023/09/22 14:59:59", "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (126501, 2002, 1, 10004, 0.0, "2023/06/30 12:00:00", -470.0, 1, "2023/09/22 14:59:59", "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (127702, 2002, 2, 10005, 0.0, "2023/09/15 15:00:00", -470.0, 2, "2023/12/22 14:59:59", "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (127702, 2002, 2, 10006, 0.0, "2023/09/15 15:00:00", -470.0, 2, "2023/12/22 14:59:59", "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (127802, 2002, 2, 10007, 0.0, "2023/09/15 15:00:00", -470.0, 1, "2023/12/22 14:59:59", "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (127802, 2002, 2, 10008, 6.5, "2023/09/15 15:00:00", -470.0, 2, "2023/12/22 14:59:59", "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (129602, 2002, 3, 10009, 0.0, "2023/12/15 15:00:00", -470.0, 2, "2024/03/22 14:59:59", "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (129602, 2002, 3, 10010, 0.0, "2023/12/15 15:00:00", -470.0, 2, "2024/03/22 14:59:59", "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (129701, 2002, 3, 10011, 0.0, "2023/12/15 15:00:00", -470.0, 1, "2024/03/22 14:59:59", "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (129701, 2002, 3, 10012, 6.2, "2023/12/15 15:00:00", -470.0, 2, "2024/03/22 14:59:59", "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130301, 2002, 4, 10013, 3.1, "2024/03/15 15:00:00", -470.0, 3, "2024/06/22 14:59:59", "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 1, 5, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130301, 2002, 4, 10014, 6.15, "2024/03/15 15:00:00", -470.0, 3, "2024/06/22 14:59:59", "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130401, 2002, 4, 10015, 0.0, "2024/03/15 15:00:00", -470.0, 2, "2024/06/22 14:59:59", "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130401, 2002, 4, 10016, 3.35, "2024/03/15 15:00:00", -470.0, 2, "2024/06/22 14:59:59", "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130502, 2002, 5, 10017, 0.0, "2024/06/15 15:00:00", -470.0, 1, "2024/09/22 14:59:59", "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130502, 2002, 5, 10018, 3.18, "2024/06/15 15:00:00", -470.0, 2, "2024/09/22 14:59:59", "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (130503, 2002, 5, 10019, 0.0, "2024/06/15 15:00:00", -470.0, 4, "2024/09/22 14:59:59", "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 3, 4, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (123301, 2002, 5, 10020, 4.9, "2024/06/15 15:00:00", -470.0, 1, "2024/09/22 14:59:59", "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (123301, 2002, 5, 10021, 4.8, "2024/06/15 15:00:00", -470.0, 1, "2024/09/22 14:59:59", "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133301, 2002, 6, 10022, 4.922, "2024/09/15 15:00:00", -470.0, 3, "2024/12/22 14:59:59", "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133301, 2002, 6, 10023, 9.638, "2024/09/15 15:00:00", -470.0, 3, "2024/12/22 14:59:59", "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 2, 5, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133401, 2002, 6, 10024, 2.88, "2024/09/15 15:00:00", -470.0, 1, "2024/12/22 14:59:59", "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133401, 2002, 6, 10025, 4.818, "2024/09/15 15:00:00", -470.0, 5, "2024/12/22 14:59:59", "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 2, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133002, 2002, 7, 10026, 1.78, "2024/12/15 15:00:00", -470.0, 2, "2025/03/22 14:59:59", "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1, 1, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133002, 2002, 7, 10027, 6.15, "2024/12/15 15:00:00", -470.0, 1, "2025/03/22 14:59:59", "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 2, 7, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133102, 2002, 7, 10028, 4.28, "2024/12/15 15:00:00", -470.0, 6, "2025/03/22 14:59:59", "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 1, 2, 0.0);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (133102, 2002, 7, 10029, 0.0, "2024/12/15 15:00:00", -470.0, 1, "2025/03/22 14:59:59", "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 2, 1, 0.0);
